import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const MessageScreen = () => {
  return (
    <View>
      <Text>MessageScreen</Text>
    </View>
  )
}

export default MessageScreen

const styles = StyleSheet.create({})
